import styled from 'styled-components';
import logo from '../../assets/logoagencia.svg';
import { useHistory, Link } from 'react-router';

export default function Navbar() {
  let history = useHistory();
  function goToHomeScreen() {
    history.push('/');
  }
  return (
    <NavbarWrapper>
      <Logo src={logo} oncClick={goToHomeScreen} />
      <LoginButton> √Årea Administrativa </LoginButton>
    </NavbarWrapper>
  );
}

const NavbarWrapper = styled.div`
  width: 100%;
  z-index: 1;
  height: 100px;
  display: flex;
  justify-content: space-between;
  padding: 20px 5%;
`;

const Logo = styled.img`
  height: 50px;
`;

const LoginButton = styled.div`
  color: white;
  font-size: 20px;
  font-weight: 500;
  cursor: pointer;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #0f3fd3;
  padding: 10px 10px;
  border-radius: 10px;
  width: fit-content;
  height: 50px;
  & > a:hover {
    border-bottom: 2px solid #ffdd33;
  }
`;
